    "clarence-rhode-national-wildlife-range-annual-narrative-report-calendar-year-1978",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Clarence Rhode
    National Wildlife Refuge outlines Refuge accomplishments during the 1978 calendar
    year. The report begins with an introduction to the Refuge and information about
    weather conditions, habitat conditions, and the system status. Construction, maintenance,
    and wildfires are also described. Habitat management is covered; wetlands are discussed.
    The wildlife section of the report discusses endangered species, threatened species,
    migratory birds, mammals, and non-migratory birds. Interpretation and recreation
    activities are outlined; topics include fishing, hunting, and law enforcement. Field
    investigations, cooperative programs, items of interest, and safety information
    are attached",nt"license_title": "License Not Specified",nt"extras":
